import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header>
      <div className="logo">elina patjas</div>
      <nav>
        <Link to="/work">Work</Link>
        <Link to="/about">About</Link>
      </nav>
    </header>
  );
}

export default Header;
